// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TeamPiggyBank {
    address public owner;
    mapping(address => uint256) public contributions;
    mapping(address => bool) public isMember;
    uint256 public totalBalance;
    uint256 public savingsGoal;
    uint256 public memberCount;
    
    struct Member {
        address memberAddress;
        uint256 contribution;
        uint256 lastContribution;
        bool isActive;
    }
    
    Member[] public members;
    
    event Deposit(address indexed contributor, uint256 amount);
    event Withdraw(address indexed contributor, uint256 amount);
    event MemberAdded(address indexed member);
    event MemberRemoved(address indexed member);
    event GoalSet(uint256 newGoal);
    event EmergencyWithdraw(address indexed member, uint256 amount);
    
    constructor() {
        owner = msg.sender;
        isMember[msg.sender] = true;
        members.push(Member(msg.sender, 0, block.timestamp, true));
        memberCount = 1;
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }
    
    modifier onlyMember() {
        require(isMember[msg.sender], "Only members can call this function");
        _;
    }
    
    function addMember(address newMember) external onlyOwner {
        require(!isMember[newMember], "Address is already a member");
        isMember[newMember] = true;
        members.push(Member(newMember, 0, block.timestamp, true));
        memberCount++;
        emit MemberAdded(newMember);
    }
    
    function removeMember(address member) external onlyOwner {
        require(isMember[member], "Address is not a member");
        require(member != owner, "Cannot remove owner");
        isMember[member] = false;
        memberCount--;
        emit MemberRemoved(member);
    }
    
    function setSavingsGoal(uint256 newGoal) external onlyOwner {
        require(newGoal > totalBalance, "New goal must be greater than current balance");
        savingsGoal = newGoal;
        emit GoalSet(newGoal);
    }
    
    function deposit() external payable onlyMember {
        require(msg.value > 0, "Deposit amount must be greater than 0");
        contributions[msg.sender] += msg.value;
        totalBalance += msg.value;
        
        // Update member's contribution
        for(uint i = 0; i < members.length; i++) {
            if(members[i].memberAddress == msg.sender) {
                members[i].contribution += msg.value;
                members[i].lastContribution = block.timestamp;
                break;
            }
        }
        
        emit Deposit(msg.sender, msg.value);
    }
    
    function withdraw(uint256 amount) external onlyMember {
        require(amount > 0, "Withdrawal amount must be greater than 0");
        require(amount <= contributions[msg.sender], "Insufficient balance");
        require(amount <= address(this).balance, "Contract has insufficient balance");
        
        contributions[msg.sender] -= amount;
        totalBalance -= amount;
        
        // Update member's contribution
        for(uint i = 0; i < members.length; i++) {
            if(members[i].memberAddress == msg.sender) {
                members[i].contribution -= amount;
                break;
            }
        }
        
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed");
        
        emit Withdraw(msg.sender, amount);
    }
    
    function emergencyWithdraw() external onlyMember {
        require(contributions[msg.sender] > 0, "No balance to withdraw");
        uint256 amount = contributions[msg.sender];
        
        contributions[msg.sender] = 0;
        totalBalance -= amount;
        
        // Update member's contribution
        for(uint i = 0; i < members.length; i++) {
            if(members[i].memberAddress == msg.sender) {
                members[i].contribution = 0;
                break;
            }
        }
        
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed");
        
        emit EmergencyWithdraw(msg.sender, amount);
    }
    
    function getContribution(address contributor) external view returns (uint256) {
        return contributions[contributor];
    }
    
    function getTotalBalance() external view returns (uint256) {
        return totalBalance;
    }
    
    function getMemberCount() external view returns (uint256) {
        return memberCount;
    }
    
    function getSavingsGoal() external view returns (uint256) {
        return savingsGoal;
    }
    
    function getMemberDetails(uint256 index) external view returns (
        address memberAddress,
        uint256 contribution,
        uint256 lastContribution,
        bool isActive
    ) {
        require(index < members.length, "Invalid member index");
        Member memory member = members[index];
        return (
            member.memberAddress,
            member.contribution,
            member.lastContribution,
            member.isActive
        );
    }
}

